class Solution(object):
    def minKBitFlips(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        # pre-process
        L = len(nums)
        diffs = [0] * L

        # process
        idx = 0
        flips = 0
        ans = 0
        while idx < L:
            flips += diffs[idx]
            if (nums[idx] + flips) % 2 == 0:
                if idx > L - k:
                    return -1
                flips += 1
                if idx + k < L:
                    diffs[idx + k] -= 1
                ans += 1
            idx += 1

        return ans


